import React from "react";
import {Link, Redi} from "react-router-dom";
import {useGlobalContext} from "../context";

const Home = () => {
    const { user } = useGlobalContext();
    return (
        <>
            {user && <Redirect to='/dashboard' />}
        </>
    )
}
export default Home;
